// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract PizzaDelivery {
    enum TaskState { NotStarted, InProgress, Completed }
    mapping(uint => TaskState) public taskStates;
    address[3] public participants;
    uint public currentTask = 1;

    struct TokenState {
        uint currentTask;
    }
    TokenState public tokenState;

    constructor(address[3] memory _participants) {
        participants = _participants;
    }

    modifier onlyParticipant(uint participantId) {
        require(msg.sender == participants[participantId], "Only the designated participant can call this function.");
        _;
    }

    function enact(uint taskID) external onlyParticipant(getParticipantIdForTask(taskID)) {
        require(taskID == currentTask, "Task must be executed in order.");
        require(taskStates[taskID] == TaskState.NotStarted, "Task already started or completed.");

        taskStates[taskID] = TaskState.InProgress;

        if (taskID == 1) {
            // Order Pizza - Customer
            currentTask = 2;
        } else if (taskID == 2) {
            // Confirm ETA - Pizza Place
            currentTask = 3;
        } else if (taskID == 3) {
            // Announce Delivery - Pizza Place
            currentTask = 4;
        } else if (taskID == 4) {
            // Deliver Pizza - Delivery Boy
            currentTask = 5;
        }

        taskStates[taskID] = TaskState.Completed;
    }

    function getParticipantIdForTask(uint taskID) internal pure returns (uint) {
        if (taskID == 1) return 0; // Customer
        else if (taskID == 2 || taskID == 3) return 1; // Pizza Place
        else if (taskID == 4) return 2; // Delivery Boy
        else revert("Invalid task ID");
    }

    function getState() external view returns (TokenState memory) {
        return tokenState;
    }
}
